import React, { Component } from 'react';
import { withCookies } from 'react-cookie';
import './index.css';

class InitialPhoto extends Component {
	constructor(props) {
		super(props);

		this.state = {
			open: false
		}
	}
	render() {
		return (
			<div></div>
		)
	}
}

export default withCookies(InitialPhoto);
